import "./App.css";
import axios from "axios";
import { useState } from "react";

function App() {
  const [searchText, setSearchText] = useState("");

  const submitHandler1 = async (e) => {
    e.preventDefault();
    const firstName = document.getElementsByClassName("firstName");
    const lastName = document.getElementsByClassName("lastName");
    const age = document.getElementsByClassName("age");
    const talent = document.getElementsByClassName("talent");

    console.log(firstName.value);

    const newPeople = {
      firstName: firstName.value,
      lastName: e.target.value,
      age: e.target.value,
      talent: e.target.value,
    };
    console.log(newPeople);
    try {
      await axios.get("http://localhost:4000/people", {}).then(
        (response) => {
          console.log(response);
        },
        (error) => {
          console.log(error);
        }
      );
    } catch (error) {
      console.log(error);
    }
  };

  const submitHandler2 = async (e) => {
    e.preventDefault();

    try {
      await axios.get("http://localhost:3000", {}).then(
        (response) => {
          console.log(response);
        },
        (error) => {
          console.log(error);
        }
      );
    } catch (error) {
      console.log(error);
    }
  };

  const submitHandler3 = async (e) => {
    e.preventDefault();

    try {
      await axios.get("http://localhost:8080", {}).then(
        (response) => {
          console.log(response);
        },
        (error) => {
          console.log(error);
        }
      );
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <form>
        <table>
          <tbody>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Age</th>
              <th>Talent</th>
            </tr>
            <tr>
              <td>
                <input
                  className="firstName"
                  type="text"
                  placeholder="First Name"
                />
              </td>
              <td>
                <input
                  className="lastName"
                  type="text"
                  placeholder="Last Name"
                />
              </td>
              <td>
                <input className="age" type="number" placeholder="Age" />
              </td>
              <td>
                <input className="talent" type="number" placeholder="Talent" />
              </td>
            </tr>
          </tbody>
        </table>
        <br></br>
        <div>
          <button className="button1" onClick={submitHandler1} type="submit">
            1
          </button>
          <button className="button2" onClick={submitHandler2} type="submit">
            2
          </button>
          <button className="button3" onClick={submitHandler3} type="submit">
            3
          </button>
        </div>
      </form>
    </div>
  );
}

export default App;
